import Card from "components/card";
import Progress from "components/progress";
import axios from "axios";
import React from "react";

const baseURL = "http://localhost/api/manifestations/";

function ManifTable() {

    const [post, setPost] = React.useState(null);

    const headers = {
      'Content-Type': 'application/json',
    }

    React.useEffect(() => {

      // axios.get(baseURL,{headers : headers}).then((response) => {
      //   setPost(response.data);
      // });

      axios({
        url: "http://localhost/api/manifestations/",
        method: 'get',
        headers: { "Content-Type": "application/json" }
      })
        .then(res => {
          setPost(res.data);
          console.log(`Axios Call completed: ${res}`)
        });


    }, []);
  
    if (!post) return null;

  return (
    <Card extra={"h-[600px] w-full"}>

        <div className="flex h-fit w-full items-center justify-between rounded-t-2xl bg-white px-4 pt-4 pb-[20px] shadow-2xl shadow-gray-100 dark:!bg-navy-700 dark:shadow-none">
            <h4 className="text-lg font-bold text-navy-700 dark:text-white">
            Liste des Manifs
            </h4>
            <button className="linear rounded-[20px] bg-lightPrimary px-4 py-2 text-base font-medium text-brand-500 transition duration-200 hover:bg-gray-100 active:bg-gray-200 dark:bg-white/5 dark:text-white dark:hover:bg-white/10 dark:active:bg-white/20">
            Ajouter une nouvelle
            </button>
        </div>

        <PersonList/>
        
    </Card>
  );
}

export default ManifTable;
